const BackTopButton = () => {
    const style = {
        height: 40,
        width: 40,
        lineHeight: '40px',
        borderRadius: 4,
        backgroundColor: 'gray',
        color: 'white',
        textAlign: 'center',
        fontSize: 14,
      };

    return (
        <BackTop>
            <div style = {style}>
                BackTop
            </div>
        </BackTop>
    );
};

export default BackTopButton;
